import styled from "styled-components";
import recommendTopBg from "@/assets/img/recommend-top-bg.png";

export const RankingWrapper = styled.div`
  .tops {
    margin: 30px 0;
    display: flex;
    background-image: url(${recommendTopBg});
    height: 472px;
  }
`;
